import React, { Component } from "react";
import Card from "./Card";
import Banjo from "./Banjo.png";
import Byleth from "./Byleth.png";


const CardList = ({ characters}) => {
    return(
        <div>
            {/* Banjo & Kazooie */}
            <Card 
            id={characters[0].id} 
            name={characters[0].name}
            series={characters[0].series}
            image= {Banjo}
            />

            {/* Byleth */}

            <Card 
            id={characters[1].id} 
            name={characters[1].name}
            series={characters[1].series}
            image={Byleth}/>

        </div>
    )

}

export default CardList
